import './App.css';
import { createBrowserRouter, RouterProvider } from "react-router-dom"
import Main from './Layouts/Main';
import Order from './components/Orders/Order';

function App() {
  const router = createBrowserRouter([
    {
      path: '/',
      element: <Main></Main>
    },
    {
      path: '/order',
      element: <Order></Order>
    },
  ])
  return (
    <div>
      <RouterProvider router={router}>

      </RouterProvider>
    </div>
  );
}

export default App;
